window.bookSummaryJSON = "<p><b>I'm the girl next door who looks for love in all the wrong places.</b></p> <p>Until the day my smoking hot neighbors who've always treated me like a little sister rescue me from the men who hurt me.</p> <p>They tend my wounds. They care for me. They make me whole again.</p> <p>Now the gloves are off. They're my fated mates, and they won't give me up for anyone.</p> <p>My enemies are determined to find and enslave me, but my three possessive, dangerous, and slightly unhinged alphas will lay waste to an entire city if that's what it takes to keep me safe. And they may just have to.</p>"; 
